import React, { Component } from 'react';
import Form from 'react-bootstrap/Form';
import Col from 'react-bootstrap/Col';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import FormControl from 'react-bootstrap/FormControl';

import classes from './Create.module.css';

import { workoutSessionForm } from '../../../../../../shared/form-utility';
import { formObjectToArray } from '../../../../../../shared/utility';

class WorkoutSessionCreate extends Component {
    state = {
        form: workoutSessionForm
    }

    render () {
        let jes = formObjectToArray( this.state.form ).map( ele => {
            console.log(ele);
        });

        const form = (
            <Form>
                <Form.Row className="align-items-center">
                    <Col xs="auto" className="my-1">
                        <Form.Label> Weight </Form.Label>
                    </Col>
                    <Col sm={6} className="my-1">
                        <Form.Label htmlFor="weight" srOnly>
                            Weight
                        </Form.Label>
                        <Form.Control id="weight" placeholder="Jane Doe" />
                    </Col>
                    <Col sm={4} className="my-1">
                        <Form.Label htmlFor="weightUnit" srOnly>
                            unit
                        </Form.Label>
                        <Form.Control as="select" defaultValue="Choose..." id='weightUnit'>
                            <option>Choose unit...</option>
                            <option value="cm">cm</option>
                            <option value="inch">inch</option>
                        </Form.Control>
                    </Col>
                </Form.Row>

                <Form.Row className="align-items-center">
                    <Col xs="auto" className="my-1">
                        <Form.Label> Waist </Form.Label>
                    </Col>
                    <Col sm={6} className="my-1">
                        <Form.Label htmlFor="waist" srOnly>
                        Waist
                        </Form.Label>
                        <Form.Control id="waist" placeholder="Jane Doe" />
                    </Col>
                    <Col sm={4} className="my-1">
                        <Form.Label htmlFor="waistUnit" srOnly>
                            unit
                        </Form.Label>
                        <Form.Control as="select" defaultValue="Choose..." id='waistUnit'>
                            <option>Choose unit...</option>
                            <option value="cm">cm</option>
                            <option value="inch">inch</option>
                        </Form.Control>
                    </Col>
                </Form.Row>
            </Form>
        );

        return (
        <div className={classes.Create}>
            { form }
        </div>
        );
    }
};

export default WorkoutSessionCreate;
